import React from "react";
import "./Sidebar.css";
import Logo from "../../imgs/logo.JPG";

const Sidebar = () => {
  return (
    <div className="Sidebar">
      <div className="logo">
        <img src={Logo} alt="logo" />
        <span>Dubu Natural</span>
      </div>
    </div>
  );
};

export default Sidebar;
